import React from "react";
import "./style.scss";
import {Grid, Row, Col} from "react-bootstrap";
function Main() {
  return (
      <Grid className="fondo">
          <Row>
            <Col>1</Col>
            <Col>1</Col>
            <Col>1</Col>
            <Col>1</Col>
          </Row>
      </Grid>
  );
}

export default Main;
